import React, {useState} from 'react';
import {Button, Card, CardBody, Col, Collapse, Row} from 'reactstrap';
import classes from './advancedSearch.module.css'
import Translate from "../../../../../Translate";
import SearchIcon from '@material-ui/icons/Search';
import CheckboxesUi from "../../../../../components/checkBoxUI/checkBoxUI";
import SwitchesUi from "../../../../../components/switchUI/switchUI";
import ButtonUi from "../../../../../components/buttons/buttonUi";
import SelectUi from "../../../../../components/selectUI/selectUI";
import TuneIcon from '@material-ui/icons/Tune';
import SettingsIcon from '@material-ui/icons/Settings';
import FindInPageIcon from '@material-ui/icons/FindInPage';
import RadioUi from "../../../../../components/radioUI/radioUI";
import ClassifiersModal from "../classifiersModal/classifiersModal";

const AdvancedSearch = (props) => {
    const [isOpen, setIsOpen] = useState(false);
    const [type, setType] = useState(false)
    const [displayNumbers] = useState([
        {id: 1, name: 'Show the first 10 pieces', value: 10},
        {id: 2, name: 'Show the first 50 pieces', value: 50},
        {id: 3, name: 'Show the first 100 pieces', value: 100},
    ])

    const toggle = () => {
        setIsOpen(!isOpen)
        setType(!type)
    };

    return (
        <div>
            <ClassifiersModal
                groups={props.groups}
                subGroups={props.subGroups}
            />
            <Button className={classes.searchBtn} color={type ? 'success' : 'primary'} onClick={toggle}
                    style={{marginBottom: '1rem'}}>
                <Translate name={props.buttonName}/> <SearchIcon className={classes.icon}/>
            </Button>
            <Collapse isOpen={isOpen}>
                <Card>
                    <CardBody>
                        <Row>
                            <Col md={4} className={classes.searchWindow}>
                                <h5>
                                    <FindInPageIcon className='mr-1'/>
                                    <Translate name={'Search settings'}/>
                                </h5>
                                <hr/>
                                {
                                    Object.keys(props.searchItemsKey).map(
                                        (item, index) => {

                                            return (
                                                <p key={index}>
                                                    <CheckboxesUi
                                                        checked={false}
                                                        label={item}
                                                        size={"small"}
                                                        color={"primary"}
                                                    />
                                                </p>
                                            )
                                        }
                                    )
                                }
                            </Col>
                            <Col md={3}>
                                <h5>
                                    <TuneIcon  className="mr-1"/>
                                    <Translate name={'filters'}/>
                                </h5>
                                <hr/>
                                <div className={classes.searchWindow}>
                                    <h6 className={classes.secondHeader}><Translate name={'groups'}/></h6>
                                    <ButtonUi
                                        width={'auto'}
                                        height={'auto'}
                                        label={<Translate name={'Classifiers'}/>}
                                        name={'classifiers'}
                                        color={'primary'}
                                        variant={'contained'}
                                        padding={'2px 10px'}
                                        fontSize={'12px'}
                                        fontWeight={700}
                                    />

                                </div>
                                <h6 className={classes.secondHeader}><Translate name={'image'}/></h6>
                                <SwitchesUi
                                    label={'Image'}
                                />
                                <h6 className={classes.secondHeader}><Translate name={'status'}/></h6>
                                <SwitchesUi
                                    label={'active'}
                                />
                                <h6 className={classes.secondHeader}><Translate name={'suppliers'}/></h6>
                                <SwitchesUi
                                    label={'suppliers'}
                                />
                            </Col>
                            <Col md={5}>
                                <h5>
                                    <SettingsIcon className="mr-1"/>
                                    <Translate name={'Additional settings'}/>
                                </h5>
                                <hr/>
                                <RadioUi
                                    headerName={'Number of displays'}
                                    data={displayNumbers}
                                    name={'displayNumber'}
                                    color={'primary'}
                                    size={"small"}
                                />
                            </Col>
                        </Row>
                    </CardBody>
                </Card>
            </Collapse>
        </div>
    );
}

export default AdvancedSearch;
